hello-world/.body:
Hello World
Le code source suivant est la version Ymir du celebre programme Hello World.
// C'est une commentaire

// Cette fonction est la première fonction appelé par l'exécution du programme
def main () {
    // Affiche 'Hello World !!' sur la console
    println ("Hello World !!");
}

L'exécutable peut être généré grâce au compilateur GYC
$ gyc hello.yr
$ ./a.out
Hello World !!

hello-world/commentaires.html.body:
Commentaires
Ymir propose différent types de commentaires. Ces commentaires sont pour le moment ignoré à la compilation, mais vont - dans un futur proche - servir à écrire la documentation.


// Une ligne de commentaire qui s'arrête à la fin de la ligne



/* Plusieurs lignes de commentaire qui s'arrête au caractère de fermeture */



def main () {
    // Ceci est un exemple de commentaire

    /* 
     * Ceci est un autre type de commentaire 
     * Où les étoiles sont optionnel
     */

    /*
    Ceci en est la preuve    
    */  

    // Aucune de ces lignes ne va influencer la compilation

    let x = 1 + /* 2 + */  3;
    assert (x == 4); // assert fait planter le programme si le test est faux.
}

expressions/variables.html.body:
Variables
Comme dans beaucoup de langage Ymir permet de stocker des données dans des variables. Il y a différent type de variables, avec différent type de durée de vie.
Variables locales
Le mot clé let vous donne la possibilité de crée une nouvelle variable. Une variable existe pendant la durée d'un scope, qui est une portion de code dans laquelle la variable est accessible.
let a = 12;
let b = 34;
{ // Ouvre un nouveau scope
    let c = a * b;
} 

println (c); // Illegale, c n'existe plus dans ce scope

Variable de compilation
cte (Compile Time Execution) variables sont des variables dont la valeur est connu à la compilation. Vous pouvez changer leurs valeurs si la nouvelle valeur est également connu à la compilation. Le mot clé cte vous permet de déclarer des variables connu à la compilation.
let cte a = 12;
a = 45; // Ok
a = some_runtime_function (); // Illegal

Const
Le mot clé const permet de rendre la variable immutable et d'empêcher sa modification.
let const a = some_function_returning_i32 ();
a = 45; // Illegal

L'information const est transitive, par exemple pour un pointeur constant on ne peut ni changer la valeur du pointeur ni la valeur des éléments pointés.
let array = some_function_returing_array () // [ [char] ];
array [0][1] = 'r'; // ok

let const array_b = array;
array_b [0][0] = 'r'; // Illegal

expressions/tableaux-et-slices.html.body:
Tableaux et slices
Arrays
Un tableau est une collection de valeurs du même type, stockés dans un espace mémoire contigu. Un tableau possède une taille ainsi qu'un pointeur vers les données. Il peut être représenté comme étant la structure suivante {u64 size; p!T data}, où T est le type des données stocké par le tableau.
// Calcule la sum d'un tableau d'entier
def foo (a : [i32]) -> i32 {
    let sum = 0;
    for it in a {
        sum = sum + it;
    }
    return sum;
}

def main () {
    // array is [i32 ; 5U]
    let array = [1, 2, 3, 4, 5];

    // Allocate an array of i32 of size 100U
    let aux = [i32 ; new 100U]; 

    // Tableau statique de 10 entier, dans la pile
    let aux2 = [i32 ; 10U];

    println ("Le premier élément est ", array [0]);
    println ("Le dernier élément est ", array [array.len - 1U]);
    println ("La somme du tableau = ", foo (array));
}

Slice
Les slices sont des éléments présent dans le langage qui présente un comportement différents des tableaux, et qui servent à accéder à une section d'un tableau. Il ont une taille, qui ne peut pas être modifié.
def foo (a : [i32]) -> i32 {
    let sum = 0;
    for it in a {
        sum += it;
    }
    return sum;
}

def main () {
    let a = [1, 2, 3, 4, 5];
    a [0 .. 2] = [1, 2]; // Ok
    a [0 .. 2] = [1, 2, 3]; // Assert Error, size mismatch
    a = [1, 2, 3]; // Ok

    a [0 .. 2] = a [2 .. 4];
    println (foo (a [2 .. a.len]));    
}

expressions/ranges.html.body:
Ranges
Le type range est une paire de valeurs du même type. Ces types peuvent être soit entier, flottant ou de type char.
def main () {
    // rng is r!(i32);
    let rng = 1 .. 3; // equivalent à l'interval [1, 3[

    // Range est un type iterable
    // 
    for it in 0 .. 6 {
        print (it, ", "); // affiche "1, 2, 3, 4, 5, "
    }

    // On peut récuperer les valeurs de l'intervalle
    println ("Range (", rng.fst, " .. ", rng.scd, ')');        
}

expressions/tuples.html.body:
Tuples
Un tuple est une collection de valeurs de types différents. Il est possible de construire un tuple en utilisant les parenthèses (``). Il est possible de passer un tuple en tant que paramètre d'un fonction, ou en tant que retour de fonction pour retourner plusieurs valeurs.
def reverse (pair : (i32, bool)) -> (bool, i32) {
    let (x, y) = pair;
    return (y, x);
}

def main () {
    let tuple = (1, true);
    let rev = reverse (tuple);    
}

Le mot clé expand permet de deconstruire un tuple, et de le passer en tant que paramètres de fonction, ou lors de la création d'un tuple plus grand.
def foo (a : i32, b : char) {
    println (a, " ", b);
}

def main () {
    let tuple = (1, 't');
    foo (tuple::expand);
    let tuple_2 = (1, tuple::expand);
}

Il est possible de récupérer une valeur d'un tuple en utilisant l'operateur ..
def main () {
    let tuple = (1, 2, 3);
    println (tuple.0, " ", tuple.1, " ", tuple.2);
}

expressions/structures-de-controle.html.body:
Structures de contrôle
Pour créer un programme fonctionnel, il vous faut être en mesure de prendre des décision, d'itérer sur des ensembles, ou de répéter des instructions plusieurs fois. Cette partie va présenter les structures de contrôles offertes par le langage Ymir.
Condition
La structure de contrôle la plus simple est la construction if else.
if a 
En Ymir, une condition doit être du type bool, il est impossible d'utiliser d'autres types comme des entiers comme on pourrait le faire dans d'autre langage proche du C. Le contenu d'une instruction if est un bloc d'instruction, où la création d'un bloc contenant plusieurs instructions avec les jetons { } est optionnel, si vous voulez n'executer qu'une seule instruction.
La construction if else peut être utilisé comme une expression, vous pouvez par conséquent récupérer la valeur d'une expression conditionnel.
let x = true;
let a = 1 + if (x) 100 else 2;

Boucle
Le langage Ymir propose plusieurs structure de controle permettant de boucler, ou d'iterer sur un ensemble
While
La boucle while est très similaire à celle d'autres langages proche du C.
let i = 0;
while i 
Break
Parfois, il est pratique de pouvoir stopper une boucle avant que sa condition ne la force à s'arrêter. Le mot clé break vous permet de le faire.
let i = 0;
while i 
Vous pouvez utiliser le mot clé break pour stopper une boucle parent en utilisant un tag.
let i = 0;
let j = 0;
while: firstLoop (i 
For
La boucle for vous permet d'itérer sur une collection d'élément comme un tableau, ou un range.
for i in ["One", "Two", "Three"] {
    print (i, ","); 
} // One, Two, Three,

let a = [5, 3, 1];
for i in 0 .. 3 {
    print (i, ","); }
} // 0, 1, 2,

for i in 0UL .. a.len {
    print (a [i], ","); 
} // 5, 3, 1, 

for i in 3 .. 0 {
    print (i, ",");
} // 3, 2, 1,

Tout comme pour les boucle while, il est possible de tagger une boucle for afin de pouvoir y faire référence dans une instruction break.
for:loop (i in [1, 2, 3]) {
    break loop;
}

types-personnalises/structures.html.body:
Structures
Une structure est un type personnalisé, permettant de regrouper plusieurs valeurs dans un type ayant un nom. Leur composition est équivalente à celle des tuples, on peut voir les tuples comme des structures anonymes. Le mot clé struct permet de définir un nouveau type.

// Une structure avec deux champ
struct  
| x : double,
| y : double
-> Point;

// Une structure peut contenir des champ dont le type est une structure
struct
| a : Point
| b : Point
-> Rectangle;

def main () {
    // Il faut remplir toutes les données pour construire une structure
    let point = Point { 1.1, 1.7 };

    // Il est également possible de construire une structure sans lui donner de valeur
    // Tout les champs seront remplis avec leur valeur ::init
    let point2 = Point::init; 

    // Il est possible de transformer une structure en tuple
    let (x, y) = point.tupleof;
    println ("(", x, ", ", y, ")");

    let rect = Rectangle { point, Point { 3.3, 4.5 } };

    // Les structure sont des éléments affichables
    println (rect);
}

Attribut de structure
Il est possible de modifier l'alignement des types dans une structure. Pour ça, il faut utiliser un attribut de structure, qui se déclare en même temps que la structure grâce au jeton @.

struct @packed
| a : char 
| b : i32
| c : char
 -> Packed;

struct 
| a : char
| b : i32 
| c : char 
 -> Unpacked;

def main () {
    println (Packed::sizeof); // 6
    println (Unpacked::sizeof); // 12
}

types-personnalises/unions.html.body:
Union
Les types union sont équivalent au type struct, à l'exception que les champs qui composent une union partage la même zone mémoire. Le mot clé union permet de déclarer un type union. 
union 
| i : i32
| d : f64
 -> MyUnion;

def main () {

    // Un seul des éléments de l'union est nécessaire pour la construire
    // Le premier élément compatible est utilisé 
    let a = MyUnion { 12 }, b = MyUnion { 1200.05 };
    let c = MyUnion {'r'}; // Erreur

    println (b.i, " ", b.d, " ", b::sizeof); // 858993459 1200.050000 8        
}

types-personnalises/enums.html.body:
Enums
Les enum sont des types spéciaux possédant un ensemble de valeurs constantes. Le mot clé enum permet de définir un type enumeré, dont le type des champs est inféré à la compilation. Il est obligatoire que chacun des champs possède le même type.
// Cette enum est de type string
enum 
| Engineer : "eng",
| Scientist : "sci"
 -> Person;

// Cette fonction prend un enum de type Person en paramètre
def inspect (p : Person) {

    // On utilise le pattern matching pour choisir entre plusieurs valeur
    match p {
        Person::Engineer => println ("Engineer");
        Person::Scientist => println ("Scientist");
    }
}

def main () {
    let michel = ("Michel", Person::Engineer);

    inspect (michel.1);
    inspect (Person::Scientist);
}

fonctions/main.html.body:
Fonctions
Les fonctions pures
Les fonctions pure sont des fonctions, dont on connaît toutes les informations nécessaire pour qu'elle soit compilé, c'est à dire que : 

tous les types des paramètres sont connu
elle possède un corps

Le type de retour n'est pas nécessaire pour qu'une fonction soit pure, il sera inféré lors de sa compilation.
La fonction main est toujours pure, même si le type du paramètre d'entrée n'est pas donné, il sera inféré à [ [char] ].
def maPremiereFonctionPure (a : i32, b : f32) -> f32 {
    return cast!f32 (a) + b;
}

def maDeuxiemeFonctionPure (a : i32, b : [char]) {
    return b [a]; // le type de retour n'est pas donné, mais inféré à char
}

Une fonction ne peut retourner qu'un seul type qui doit être connu à la compilation.
def maFonctionImpossible (a : i32) {
    if a 
Cas particulier
Il existe un cas particulier où le type de retour d'une fonction pure ne peut pas être déduis, le cas des fonction récursive.
def fibo (n : i32) {
   if n = 1 { return facto (n - 1) * n; } // Erreur, on ne connaît pas le type de facto
  else return 1;
}

Une fonction pure provenant d'un autre module que celui en cours de compilation (cf. Modules) sera importé comme étant une fonction externe, par conséquent, si son type de retour n'est pas définis, il sera définis comme étant void.
Les fonction impures
Les fonction impures contrairement au fonction pure, manque d'information pour être compilé directement, mais possèdent un corp. Ces fonction vont donc être compilé uniquement lorsqu'elle seront référencé (généralement par un appel).
Le types des paramètres qui ne sont pas connu vont alors être inféré grâce à ceux des paramètre de l'appel. 
def foo (a, b : i32, c) { // a et c n'ont pas de type
   // ...
} 

// ...
foo (10, 2, "salut"); // OK, avec a : i32 et c : string
foo (10, "salut", 1); // Erreur, b doit être de type i32

Les fonctions externes
Les fonctions externes sont des fonctions dont on connaît le type de tout les paramètres, mais qui ne possède pas de corp. Elle sont utilisable comme tous les autres types de fonctions. Le type de retour des fonctions externes doit être donné, si ce n'est pas le cas, elle sera considéré comme void.
extern foo (a : i32) -> i32; 

println (foo (10)); // Ok

Surcharge
Toutes les fonctions peuvent être surchargé, qu'elle soit pure ou non. Lors de l'appel, la fonction la plus proche des types passé en paramètre sera appelé.
def foo (a : i32, b) {
// ...
}

def foo (a, b : i32) {
// ...
}

//...
foo (10, "salut"); // la première fonction est appelé
foo ("salut", 10); // la deuxième fonction est appelé
foo (10, 10); // Erreur, la surcharge fonctionne autant avec les deux prototypes.

Décorateur de paramètres
Il existe deux décorateur de paramètre pour spécifié un comportement 

const, le paramètre ne pourra pas être modifié quel que soit son type (cf. Variables)
ref, le paramètre est passé par référence, une lvalue est requise. Toute modification de la variable dans la fonction appelé modifira également la variable de la fonction appellante.

def foo (ref a) {
    a = 12;
}

def bar (const a : [i32]) {
    a [0] = 8; // Erreur le tableau est constant
}

let a = 1;
foo (10); // Erreur 10 n'est pas une lvalue
foo (a);
assert (a == 12);

bar ([1, 2, 3]); // Ok

Le décorateur const est transitif et n'est pas ôtable.
def foo (a : [char]) {
    // ...
}

def bar (const a : [char]) {
    // ...
}

let a = "test"; // [const (char)];
foo (a); // Erreur, on perd le const
bar (a); // Ok, le const est transitif, const ([char]) est plus global que [const (char)]

let b = [char ; new 10U]; // [char]
bar (b); // Ok, on peut passer un élément non constant en tant qu'élément constant

fonctions/attributs.html.body:
Attributs de fonctions
Les fonctions peuvent être paramétrées grâce à des attributs. Les attributs sont définis avec le jeton @. 
// 
def @{safe, inline} foo () {
}

def @inline bar () {
}

Inline
Comme son nom l'indique l'attribut inline va permettre d'inliner la fonction. En d'autre terme, contrairement à un appel de fonction normal, le corps de la fonction va être collé dans la fonction de l'appellant. 
def @inline foo (a : i32) {
    return a + 12;
}

println (foo (10));

Va être réecris en : 
println (22);

Il est impossible d'inliner une fonction récursive, mais toutes les autres fonctions peuvent être inliné. L'inline contrairement à d'autre langage proche du C est une directive obligatoire, le compilateur est obligé d'inliner la fonction.
def @inline fibo (n : i32) {
    if n 
Safe
Le mot clé safe ajoute des vérification sémantique à la fonction, spécifiant que celle-ci ne peut pas effectuer certaines opération dangereuse. Une fonction safe ne peut ainsi pas faire planter un programme.
Les trois opérations interdites dans un contexte safe sont :

Appeler une fonction non-safe
Déréférencer un pointeur
Allouer de la mémoire

Toutes les autres opérations sont autorisés.
Trusted
L'attribut trusted permet de faire le lien entre les fonctions bas niveau et les fonction safe. Il ne doit pas être utilisé à la légère. Il définit qu'une fonction non safe peut quand même être appelé depuis un contexte safe, car la fonction a été vérifié à la main auparavant. 
Cet attribut est hautement déprecié.
